const APP_KEY = process.env.REACT_APP_APP_KEY

export function fetchDictionary (word = '') {
  word = word.trim()

  const url = `https://owlbot.info/api/v4/dictionary/${word}`

  const params = {
    method: 'GET',
    headers: {
      Authorization: 'Token ' + APP_KEY
    }
  }

  fetch(url, params)
    .then((res) => res.json())
    .then((result) => console.log(result))
}
